import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Stack from "@mui/material/Stack";
import Button, { ButtonProps } from "@mui/material/Button";
import Checkbox, { CheckboxProps } from "@mui/material/Checkbox";
import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import { styled } from "@mui/material/styles";

const ColorButton = styled(Button)<ButtonProps>(({ theme }) => ({
  color: theme.palette.getContrastText("#2f49d1"),
  backgroundColor: "#2f49d1",
  "&:hover": {
    backgroundColor: "#2f49d1",
  },
}));

export default function Login() {
  return (
    <section className="c-login">
      <div className="c-login__card">
        <FormGroup>
          <Box
            component="form"
            sx={{
              "& > :not(style)": { m: 1, width: "45ch" },
            }}
            noValidate
            autoComplete="off"
            className="c-login__card__form"
          >
            <TextField
              id="outlined-basic"
              label="Outlined"
              variant="outlined"
            />
            <TextField
              id="outlined-basic"
              label="Outlined"
              variant="outlined"
            />
            <TextField
              id="outlined-basic"
              label="Outlined"
              variant="outlined"
            />
            <span>Forgot your password?</span>
            <label className="c-login__card__form__checkbox">
              <input type="checkbox" />
              <span className="c-login__card__form__checkbox__label">
                Remember me next time
              </span>
            </label>
            <Stack direction="column">
              <Button variant="contained" color="#2f49d1">
                Contained
              </Button>
            </Stack>
          </Box>
        </FormGroup>
      </div>
    </section>
  );
}
